        const errorMessage = "Invalid PDF";
        const errorPage = `
          <html>
            <head>
              <style>
                body {
                  display: flex;
                  justify-content: center;
                  align-items: center;
                  height: 100vh;
                  font-family: Arial, sans-serif;
                }
              </style>
            </head>
            <body>
              <p>${errorMessage}</p>
            </body>
          </html>
        `;
        const newWindow = window.open("http://localhost:5100", "_blank", `width=${width},height=${height}`);
        if (newWindow) {
          newWindow.document.open();
          newWindow.document.write(errorPage);
          newWindow.document.close();
        } else {
          throw new Error("Failed to open error window.");
        }
      }
    } catch (error) {
      console.error("Error:", error);
    }
  }, []);




