    width = 768;
    height = 1024;
  } else if (window.screen.width <= 568) {
    width = 568;
    height = 320;
  }
  window.open("http://127.0.0.1:5022/api/pdf22", "_blank", `width=${width},height=${height}`);
  }, []);

return (
